Defendant Ronald C Weiss in court, in custody, with attorney Amber K. Rumpf.  Ted Szczupakiewicz appeared for the State of Wisconsin.  State files Amended Information.  Defendant enters a plea of no contest to Count 1.  Court finds defendant guilty.  Court conducts plea colloquy with defendant.  State makes sentencing recommendations.  Defense makes sentencing.  

The Defendant was sentenced to the following:

IMPOSED SENTENCE of: 

7 YEARS and 3 MONTHS IMPRISONMENT (CREDIT - 816 days).  Concurrent to current sentence.  
  -  2 YEARS AND 3 MONTHS OF INITIAL CONFINEMENT
  -  5 YEAR(S) OF EXTENDED SUPERVISION

CONDITIONS OF EXTENDED SUPERVISION:  
*Maintain full time employment;
*Not to use or possess a computer or electronic device without agent approval;
*Not to use or possess any sexually suggestive materials;
*Psychological evaluation and treatment deemed appropriate;
*No contact with victim or her family;
*No unsupervised contact with any minor;
*Sex offender treatment;
*Absolute Sobriety; Random U.A.'s; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed;
*Inform Agent of all prescriptions;
*Follow through with any treatment and/or counseling recommended by Agent.

COURT COSTS:  $268.00 (to be paid from prison wages and/or to be paid as a condition of extended supervision);

DNA SURCHARGE:  $250.00 (to be paid from prison wages and/or to be paid as a condition of extended supervision);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

Defendant is not eligible for Challenge Incarceration Program.
Defendant is not eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
